import React from 'react';
import { Link } from 'react-router-dom';

function Login() {
    return (
        <div className='LoginSection'>
            <h2>Login</h2>
            <form>
                ID : <input/>
                PW : <input/>
                <Link to="regist">회원가입</Link>
                <button>로그인</button>
            </form>
        </div>
    )
}

export default Login;
